function Alfeo(){var r=api+"\n"+document.getElementById("textarea-main").value;try{var e=new Interpreter(r);e.run(),$("#errorbox").addClass("hidden")}catch(n){$("#errorbox").removeClass("hidden"),document.getElementById("errorbox").innerHTML='<span class="errorname">'+n.name+'</span><br><span class="errormessage">'+n.message+"</span>"}var t=document.getElementById("result-value");t.innerHTML=e.value}function factorial(r){for(var e=1;r>1;)e*=r,r--;return e}function pow(r,e){return Math.pow(r,e)}function power(r,e){return Math.pow(r,e)}function sqrt(r){return Math.sqrt(r)}function squareroot(r){return Math.sqrt(r)}function nroot(r,e){return Math.pow(Math.abs(e),1/r)}var api=new String;